import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import CustomNavbar from '../components/CustomNavbar';
import axios from 'axios';
import activityIcon from '../images/activity.png';
import expenseIcon from '../images/expense.png';
import officelogIcon from '../images/officelog.png';
import Footer from './Footer';

export default function History({ user }) {
  const userId = user._id;
  // console.log(userId);

  const [exerciseData, setExerciseData] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);
  const [displayedItems, setDisplayedItems] = useState(10);

  useEffect(() => {
    const fetchExerciseData = async () => {
      try {
        const officelogResponse = await axios.get(`https://fitnesslogger-backend.onrender.com/officelog/getofficelog/${userId}`);
        // console.log('officelog Exercise Data:', officelogResponse.data);

        const expenseResponse = await axios.get(`https://fitnesslogger-backend.onrender.com/expense/getexpense/${userId}`);
        // console.log('expense Exercise Data:', expenseResponse.data);

        const activityResponse = await axios.get(`https://fitnesslogger-backend.onrender.com/activity/getactivity/${userId}`);
        // console.log('activity Exercise Data:', activityResponse.data);

        const combinedExerciseData = [
          ...(officelogResponse.data || []),
          ...(Array.isArray(expenseResponse.data) ? expenseResponse.data : [expenseResponse.data]),
          ...(Array.isArray(activityResponse.data) ? activityResponse.data : [activityResponse.data]),
        ];

        setExerciseData(combinedExerciseData);
        setIsLoading(false);
      } catch (error) {
        console.error('Error fetching exercise data:', error);
        setError(error);
        setIsLoading(false);
      }
    };

    fetchExerciseData();
  }, [userId]);

  function showMoreItems() {
    setDisplayedItems(displayedItems + 3);
  }

  if (isLoading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error.message}</div>;
  }

  return (
    
    <div className="history">
    <div className="history-page">
     <CustomNavbar style={{ color: 'blue' }} />

      <div className="d-flex flex-column align-items-center">
        <h2 className="title">History</h2>
        {exerciseData.length ? (
          <div className="history-data">
            {exerciseData.slice(0, displayedItems).map((exercise) => {
              let dateToDisplay = exercise.date;
              return (
                <div className="history-div d-flex" key={exercise._id}>
                  <div className="date d-flex align-items-center">{dateToDisplay}</div>
                  <Link className="text-decoration-none" to={`/history/${exercise.type}/${exercise._id}`}>
                    {exercise.type === 'activity' ? (
                      <div className="history-card activity-title d-flex">
                        <div className="d-flex align-items-center">
                          <img alt="activity" src={activityIcon} className="history-icon" />
                        </div>
                        <div>
                          <p className="history-name">{exercise.name}</p>
                          <p className="history-index">{exercise.distance} miles</p>
                        </div>
                      </div>
                    ) : exercise.type === 'expense' ? (
                      <div className="history-card expense-title d-flex">
                        <div className="d-flex align-items-center">
                          <img alt="expense" src={expenseIcon} className="history-icon" />
                        </div>
                        <div>
                          <p className="history-name">{exercise.name}</p>
                          <p className="history-index">{exercise.weight} lbs</p>
                        </div>
                      </div>
                    ) : exercise.type === 'officelog' ? (
                      <div className="history-card officelog-title d-flex">
                        <div className="d-flex align-items-center">
                          <img alt="officelog" src={officelogIcon} className="history-icon" />
                        </div>
                        <div>
                          <p className="history-name">{exercise.name}</p>
                          <p className="history-index">{exercise.caloriesBurned} calories</p>
                        </div>
                      </div>
                    ) : null}
                  </Link>
                </div>
              );
            })}
            {exerciseData.length > displayedItems ? (
              <div className="d-flex justify-content-center">
                <button className="show-btn" onClick={showMoreItems}>
                  Show More
                </button>
              </div>
            ) : null}
          </div>
        ) : (
          <div>
            <h3 className="history-text">No exercise data yet...</h3>
            <Link to="/allexcercisepage">
              <button className="home-btn">Add Exercise</button>
            </Link>
          </div>
          
        )}
        <Footer />
      </div>
     
      </div>
      
    </div>
  );
}
